import React from 'react';
import Tile from 'tile';

class Grid extends React.Component {
	constructor(props) {
		super(props);
		Grid.instance = this;
	}

	render() {
		return(
			<div className="grid">
				<Tile destination={{ x: 0, y: 0}} />
			</div>
			);
	}
}

export default Grid;
